import React from 'react';
import './MakeupCard.css'
import MakeupDetail from '../MakeupDetail/MakeupDetail';
import { connect } from "react-redux";

const MakeupCard = ({makeup}) => {

  return(
    <article id={makeup.id} className='makeup-card'>
      <img className='makeup-image' src={makeup.image_link}></img>
      <h3>{makeup.brand}</h3>
      <p className='makeup-name'>{makeup.name}</p>
    </article>
  );
};

export default connect(mapStateToProps)(MakeupCard);
